import React, { Component } from 'react';

class ToggleAutoPredict extends Component {

  render() {
    const { from, toggleDisplay } = this.props;
    return (
      <React.Fragment>
        <div className={"close-dialog" + (from === 'close' ? '' : ' hidden')}>
          <span className="mt-15 mr-20" onClick={toggleDisplay}>Close</span>
        </div>

        <div className={"fs-18 color-blue cursor-pointer diff-issue-link" + (from === 'next' ? '' : ' hidden')} onClick={toggleDisplay}>
          Customer has a different query
            <span>&rsaquo;</span>
        </div>

      </React.Fragment>
    )
  }
}

export default ToggleAutoPredict;
